import { useEffect, useState } from "react";

import '../node_modules/bootstrap/dist/css/bootstrap.css';
import './common.css'
import { Link, useNavigate } from "react-router-dom";



import image from './images/im4.jpg';
import image1 from './images/im4.jpeg';
import image2 from './images/im3.jpeg';

function Customer()
{

  const [orderWeight, setOrderWeight] = useState("");
  const [fromAddress, setFromAddress] = useState("");
  const [toAddress, setToAddress] = useState("");
  const [branchId, setbranchId] = useState("");

  const navigate = useNavigate();

  const Track=()=>{

    if(1)
    {
     navigate("/track")
    }
  }

const orders=()=>{
  navigate("/orderlist")
}

const addOrders = async () => {
  debugger;

  if (orderWeight.length == "") {
    toast.error("Please enter first name");
  } else if (lastName.length == "") {
    toast.error("Please enter last name");
  } else if (email.length == "") {
    toast.error("Please enter email");
  } else if (mobile.length == "") {
    toast.error("Please enter mobile");
  } else if (password.length == "") {
    toast.error("Please enter password");
  } else if (confirmPassword.length == "") {
    toast.error("Please confirm password");
  } else if (password !== confirmPassword) {
    toast.error("Password does not match");
  } else {
    const response = await signUpApi(
      firstName,
      lastName,
      email,
      password,
      mobile,
      gender,

    );

    if (response.status === true) {
      toast.success("Successfully registered a new user");
      log(response.data);
      // go back to login
      navigate("/");
    } else {
      toast.error("Error while registering a new user, please try again");
    }
  }
};


    return(<> 


    <div className="length" >
  <div className="container">
    <div className='flex'>
    <div className='im'> 
    <table>
       <tr>
      <h1 className='colr'> enter order id to track the order</h1>
       </tr>
       <tr className='tr'></tr>
       <tr>
        <td>
        <input type="text" placeholder='Enter Order Id' ></input>
        <input type="button" onClick={Track} className="btn btn-primary" value="Track Order"></input>

        </td>


       </tr>
       <tr className='tr'></tr>

       <tr>
       <img src={image} alt=""/>	
       </tr>
    </table>
    </div>

    <div className='img'>
    <center>	<h1 className='fa'>Place Order And Get Best Service</h1>
    <table>

                 <tr>
                  <td>Enter Weight</td>
                  <td className='td'></td>
                  <td>
                  <input type="number"  name="name" placeholder="Order Weight" required=""   onChange={(e) => {
                  setOrderWeight(e.target.value);
                }}/>
                  </td>
                 </tr>
                 <tr className='tr'></tr>

                 <tr>
                  <td>Enter From Address</td>
                  <td className='td'></td>
                  <td>
                  <select  onChange={(e) => {
                  setFromAddress(e.target.value);
                }}>
              <option>Transport From</option>
              <option>Pune</option>
              <option>Delhi</option>
              <option>Mumbai</option>
              <option>Hinjewadi</option>
              <option>Karad</option>
              <option>Sangli</option>
            </select>                 
               </td>
                 </tr>
                 <tr className='tr'></tr>
                 <tr>
                 <td>Enter Destination</td>
                 <td className='td'></td>
                  <td>
                  <select  onChange={(e) => {
                  setToAddress(e.target.value);
                }}>
              <option>Transport To</option>
              <option>Pune</option>
              <option>Delhi</option>
              <option>Mumbai</option>
              <option>Hinjewadi</option>
              <option>Karad</option>
              <option>Sangli</option>
            </select>                 
               </td>
                 </tr>
                 <tr className='tr'></tr>

                 <tr>
                 <td>Enter branchId</td>
                 <td className='td'></td>
                  <td>
                  <select  onChange={(e) => {
                  setbranchId(e.target.value);
                }}>
              <option>select branchId</option>
              <option>1</option>
              <option>2</option>
              <option>3</option>
              <option>4</option>
              <option>5</option>
              <option>6</option>
            </select>                 
               </td>
                 </tr>
                 <tr className='tr'></tr>
                 <tr>
                  <td>
                  <input type="button"  value="Get started"  onClick={addOrders}/>  
                  </td>
                 </tr>



                </table>

    </center>
    </div>

   <div className='imag'> 

      <input type="button" className='btn btn-success'  value="Orders"  onClick={() => {
                          navigate(`/orderlist/${sessionStorage.getItem("customerId")}`);
                        }}/>

   <table>

    <tr className='tr'></tr>
    <tr className='image'>
    <img src={image1} alt=""/>	
    </tr>
    <tr className='tr'></tr>
    <tr className='image'>
    <img src={image2} alt=""/>
    </tr>
   </table>
   </div>
    </div>
    </div>        

                 </div>






        </>);
}
export default Customer;
